import React from 'react';
import './Navbar.css'; // Import your CSS file for styling

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar__logo">
        <img src="/path/to/logo.png" alt="Logo" className="logo" />
      </div>
      <div className="navbar__links">
        <a href="#" className="navbar__link">Home</a>
        <a href="#" className="navbar__link">Movies</a>
        <a href="#" className="navbar__link">TV Shows</a>
        <a href="#" className="navbar__link">Kids</a>
        <a href="#" className="navbar__link">Watchlist</a>
      </div>
      <div className="navbar__actions">
        <button className="navbar__button">Sign In</button>
        <button className="navbar__button navbar__button--primary">Subscribe</button>
      </div>
    </nav>
  );
};

export default Navbar;
